import { QqMapService } from '@/services/qq-map.service'
import { AppConfig } from '@/constants/config'
export default {
  bem: {
    map: 'modal-map-location'
  },
  name: 'StModalMapLocation',
  serviceInject() {
    return {
      appConfig: AppConfig,
      qqMapService: QqMapService
    }
  },
  props: {
    lat: {
      type: String,
      required: true
    },
    lng: {
      type: String,
      required: true
    }
  },
  data() {
    return {
      show: false
    }
  },
  mounted() {
    this.qqMapService.init({
      lat: this.lat,
      lng: this.lng
    })
  }
}
